nce.  The two covers were so out-of-left-field that I didn\'t know what to expect when they started, but boy oh boy...  did they kill them!\",\"reviewtitle\":\"Sickness\",\"reviewer\":\"mdevers\",\"reviewdate\":\"2010-10-11 16:33:48\",\"stars\":\"5\"},{\"reviewbody\":\"All I know is I just saw them for the second time and can\'t get enough. This matrix sounds amazing. Thanks \",\"reviewtitle\":\"Nothing interesting to say\",\"reviewer\":\"livemusicsociety.org\",\"reviewdate\":\"2010-11-20 07:56:01\",\"stars\":\"5\"}]', '2', '5', '39', '2014-02-28 02:18:53', '2014-02-28 02:18:53', '13', '4', '4327', '10', '0'), ('Dopapod Live at The MiddleEast (Downstairs) on 2010-12-03', '2010-12-03 00:00:00', '2010-12-03', '2010', 'Schoeps MK22>KC5>CMC6>Sonosax SX-M2>Apogee Mini-me(aes out,24bit/96khz)>COAX>Edirol R-44 + Soundboard>R-44', 'SDHC Card>USB>Macbook Pro>Audacity(mixing,amplify soundboard source)>Wave Editor(tracking,fades,resample(izotope)/dither(mbit+)to 16 bit/44.1k)>XAct(FLAC 8,ffp,fix sbe)', 'Andy Murray', 'Disc 1:\nSet 1:\n\n01 French Bowling>\n02 Happy Song>\n03 Roid Rage\n04 Turnin\' Knobs>\n05 Eight Years Ended\n06 Flipped\n07 Freight Train Filled With Dynamite>\n08 Indian Grits>\n09 Freight Train Filled With Dynamite\n10 We Are Not Alone>\n11 Onionhead\n\nDisc 2:\nEncore:\n\n12 Chocolate Salty Balls*\n\n* Included every other band on stage for jam', 'dopapod2010-12-03.Schoeps_mk22matrix_16bit', '[{\"reviewbody\":\"This show might not quite deserve 5 starts, but the fifth star was given due to progress. I have seen Dopapod play 4 times now and this was the first time I went to a show to specifically see them. They did not disappoint. THIS SHOW IS FIRE. These guys are vastly improving and becoming legit players in th scene. The show last month @ Paradise was excellent, but this one was FAR better. Check it out.\",\"reviewtitle\":\"This show rips.\",\"reviewer\":\"BostonDan\",\"reviewdate\":\"2010-12-08 15:18:35\",\"stars\":\"5\"}]', '1', '5', '40', '2014-02-28 02:18:54', '2014-02-28 02:18:54', '9', '4', '5052', '12', '0'), ('Dopapod Live at Strangecreek (Camp Keewanee) Keewanee Cabin on 2010-05-29', '2010-05-29 00:00:00', '2010-05-29', '2010', 'Schoeps MK 22>KC5>CMC6>Sonosax SX-M2>Apogee Mini-me(24 Bit/96 khz,aes out)>COAX>Edirol R-44 +Soundboard>Channels 3&4 Edirol R-44', 'SD-HC Card>USB>Vegas Pro 8(mixing)>Soundforge 10(tracking,normalizing)>FLAC Level 8', 'Andy Murray', 'Disc 1:\nSet 1:\n\n01 Intro\n02 Roid Rage\n03 Onionhead\n04 Indian Grits\n05 New James\n06 Eight Years Ended \n07 Off The Cuff\n08 Nuggy Jawson\n09 Freight Train Filled With Dynamite\n10 Bats In The Cave\n11 Might Be Wrong/National Anthem (Radiohead)\n12 Ain\'t It Funky (James Brown)\n13 Turnin\' Knobs\n14 Bahbi\n15 Robot Rock (Daft Punk)', 'dopapod2010-05-29.Schoeps_mk22_matrix_24bit', '[]', '0', '0', '41', '2014-02-28 02:18:54', '2014-02-28 02:18:54', '11', '4', '8721', '15', '0'), ('Dopapod Live at Wormtown Music Festival 2010 Camp Keewanee on 2010-09-18', '2010-09-18 00:00:00', '2010-09-18', '2010', 'Schoeps MK22>KC5>CMC6>Sonosax SX-M2>Apogee Mini-me(aes out,24bit/96khz)>COAX>Edirol R-44 + Soundboard>R-44', 'SDHC Card>USB>Macbook Pro>Audacity(mixing)>Wave Editor(tracking,fades,resample(izotope)/dither(mbit+)to 16 bit/44.1k)>XAct(FLAC 8,ffp,fix sbe)', 'Andy Murray', 'Disc 1:\nSet 1:\n\n01 Intro\n02 Indian Train\n03 Turnin\' Knobs>\n04 Eight Years Ended\n05 In Bloom*>\n06 Rap&>\n07 In Bloom*\n08 Black & White\n09 Happy Song>\n10 Freight Train Filled With Dynamite\n\nDisc 2:\nSet 1 cont\n\n11 Roid Rage\n12 Groundhogs Day^\n13 Flipped\n14 Onionhead>\n15 TNT@>\n16 Onionhead>\n17 Nuggy Jawson\n18 Robot Rock$\n19 Rage Against The Machine Medley\n\n\nDisc 3:\nSet 1 cont\n\n20 Ain\'t It Funky\n21 Bats In The Cave>\n22 Rap#>\n23 Bats In The Cave\n24 Ellemenno\n25 Off The Cuff\n26 Closer%\n27 Led Zeppelin Medley\n\n* - Nirvana\n& - Force from the Alchemystics\n^ - Primus\n@ - AC/DC\n$ - Daft Punk\n# - Tubby Love\n% - NIN', 'dopapod2010-09-18.Schoeps_mk22matrix_16bit', '[{\"reviewbody\":\"This set was absolute clown shoes!! so much fun.. It was such a laaaaate night adventure!! it truly tested the heart, soul and agility of the toughest and most bad ass  of the \\\"north east\\\" kidz...  this was definitively a set for the real dopapod headz like Beast, Chad, J-wah, Nart, Nugget and Wobz to name a few!!! :)\",\"reviewtitle\":\"wtf...\",\"reviewer\":\"LotusKid\",\"reviewdate\":\"2010-09-27 02:45:20\",\"stars\":\"5\"},{\"reviewbody\":\"This set is a lot of fun!\",\"reviewtitle\":\"Thanks\",\"reviewer\":\"Mutha Bob\",\"reviewdate\":\"2010-10-08 02:07:47\",\"stars\":\"5\"},{\"reviewbody\":\"I love this band, they are just a great mix of talented jammers. Keys, strings, and percussion at its grooviest. Just a warning though when listening to the first song Indian Train beware of the woman that is screaming for her life. She sounds like she is being stabbed. Lots of crazy crowd noise on the first track. Other than that great show. Definitely a download.\",\"reviewtitle\":\"Any respect for the archive?\",\"reviewer\":\"ShkDwnStreet\",\"reviewdate\":\"2011-12-30 15:53:49\",\"stars\":\"4\"}]', '3', '4.67', '42', '2014-02-28 02:18:56', '2014-02-28 02:18:56', '17', '4', '13217', '27', '0'), ('Dopapod Live at Harpers Ferry on 2010-03-06', '2010-03-06 00:00:00', '2010-03-06', '2010', 'Unknown', 'Unknown', 'Unknown', 'Dopapod\'s sold out show at Harpers Ferry in Allston, MA.  Dopapod\'s highest quality live recording to date.  \n\n1) Eight Years Ended>\n2) New James\n3) Roid Rage\n4) Onionhead>\n5) Indian Grits\n6) Freight Train\n7) Turnin\' Knobs\n\nMatrix recording thanks to Luke Stratton (Mondo Gecko) for the soundboard, and Andy Murray for the room recording.\n\n01. 01 Eight Years Ended\n02. 02 New James\n03. 03 Roid Rage\n04. 04 Onionhead\n05. 05 Indian Grits\n06. 06 Freight Train\n07. 07 Turnin\' Knobs', 'DP2010-03-06.HarpersFerry', '[{\"reviewbody\":\"So in the interest of full disclosure, I mixed this show live on Mondo Gecko\'s PreSonus StudioLive and did the post production mix down back at our lair with Eli (though I did not make this matrix) .... so I\'m not gonna comment on the [awesome] sound board quality.... but the boys we\'re on fire this night and the energy inside Harpers was insane. MUST. HAVE. SHOW.\",\"reviewtitle\":\"Just so tasty.\",\"reviewer\":\"Mondo Gecko\",\"reviewdate\":\"2010-04-28 17:29:29\",\"stars\":\"5\"},{\"reviewbody\":\"Hoping to make it to Heady Fest, where they are headlining\",\"reviewtitle\":\"great recording\",\"reviewer\":\"spwal\",\"reviewdate\":\"2010-04-28 17:48:30\",\"stars\":\"5\"},{\"reviewbody\":\"I found this band randomly, and they are awesome. Great first show to check out from Dopapod. Good quality and the set list isn\'t bad. This is a band too look out for most definitely!!!!\",\"reviewtitle\":\"What a find\",\"reviewer\":\"ShkDwnStreet\",\"reviewdate\":\"2011-12-30 17:25:15\",\"stars\":\"5\"},{\"reviewbody\":\"I just listened to this for the first time in awhile this morning and wow does this recording hold up well.  It is a great illustration of Dopapod\'s early work!\",\"reviewtitle\":\"Recording Holds Up!\",\"reviewer\":\"deuce2_420\",\"reviewdate\":\"2012-01-25 14:13:32\",\"stars\":\"5\"},{\"reviewbody\":\"Wow, great quality recording!!\",\"reviewtitle\":\"Sweet set\",\"reviewer\":\"Mr_Bogmonkey\",\"reviewdate\":\"2012-02-08 19:48:05\",\"stars\":\"5\"},{\"reviewbody\":\"Just like I said: Nice.\\n\\nCheers,\\nMutha Bob\",\"reviewtitle\":\"Nice.\",\"reviewer\":\"Mutha Bob\",\"reviewdate\":\"2012-06-20 03:49:06\",\"stars\":\"5\"},{\"reviewbody\":\"This recording knocks it out of the park.  The high quality recording of this show literally forced me to write my first review on this site.  It is often hard pressed to find something as good.\\n\\nTo the person(s) who brought this to us... Mondo Gecko, Andy, Eli, whoever you are, thanks!  \\n\\nLet me know how I can find more of your stuff...\",\"reviewtitle\":\"Amazing quality, A+ Sound, Oh my!\",\"reviewer\":\"dwhite\",\"reviewdate\":\"2012-10-09 18:23:27\",\"stars\":\"5\"},{\"reviewbody\":\"Excellent! Great band, great show, great recording. Very mesmerizing jam rock.\",\"reviewtitle\":\"--\",\"reviewer\":\"njpg\",\"reviewdate\":\"2013-03-06 18:37:54\",\"stars\":\"5\"},{\"reviewbody\":\"Awesome quality! Best i\'ve heard on archive! Thanks for sharing!\",\"reviewtitle\":\"Great\",\"reviewer\":\"mountainsalsa\",\"reviewdate\":\"2013-10-22 02:52:59\",\"stars\":\"5\"}]', '9', '5', '43', '2014-02-28 02:18:56', '2014-02-28 02:18:56', '21', '4', '3963', '7', '0'), ('Dopapod Live at Tammany Hall on 2010-08-05', '2010-08-05 00:00:00', '2010-08-05', '2010', 'Schoeps MK22>KC5>CMC6>Sonosax SX-M2>Apogee Mini-me(aes out,24bit/96khz)>COAX>Edirol R-44', 'SDHC Card>USB>Macbook Pro>Bias Peak Pro 5.2(tracking,fades,resample/dither to 16bit/44.1khz)>XAct(FLAC 8,ffp,fix sbe)', 'Andy Murray', 'Disc 1:\nSet 1:\n\n01 Tuning\n02 Indian Grits\n03 Dopastep\n04 Turnin\' Knobs\n05 Robot Rock#\n06 Nuggy Jawson\n07 Led Zeppelin Medley\n08 Mudwalkin\'\n\nDisc 2: \nSet 1 cont\n\n01 Freight Train Filled With Dynamite\n02 New James\n03 The Happy Song\n04 In Bloom*\n\n# - Daft Punk\n* - Nirvana', 'dopapod2010-08-05.Schoeps_mk22_16bit', '[]', '0', '0', '44', '2014-02-28 02:18:58', '2014-02-28 02:18:58', '2', '4', '6296', '12', '0'), ('Dopapod Live at Hylands Orchard & Brewery on 2011-06-18', '2011-06-18 00:00:00', '2011-06-18', '2011', 'DPA 4011 > V3 Digital > R44 (24/96)', 'SDHC Card > Sound Forge Pro 10.0 (fades, Normalize, resample iZotope 64-Bit SRC, dither iZotope MBIT+ Dither) > CD Wav (tracking) > TLH > Flac (level 8)', 'Brian V.', 'Dopapod\n2011-06-18\nDisc Jam\nHylands Orchard & Brewery\nSturbridge, MA\n\nDPA 4011 > V3 Digital > R44 (24/96)\nSDHC Card > Sound Forge Pro 10.0 (fades, Normalize, resample iZotope 64-Bit SRC, dither iZotope MBIT+ Dither) > CD Wav (tracking) > TLH > Flac (level 8)\nROC/DIN/7 1/2\' ft. high\nTags added in Foobar2000\n\nTaped and Transferred by Brian 