c fan base...and completely free multi track soundboard with some of their latest songs.  Throw on top of all that they\'re the hardest working band on the east cost if not the whole country...well Dopapod is just the sickest band on earth.\\n\\nTen stars!\",\"reviewtitle\":\"Dopapod is Sick\",\"reviewer\":\"stevegolfer66\",\"reviewdate\":\"2013-03-20 02:36:36\",\"stars\":\"5\"}]', '1', '5', '300', '2014-02-28 02:22:38', '2014-02-28 02:22:38', '26', '4', '7592', '14', '0');
INSERT INTO `Shows` VALUES ('Dopapod Live at The Palladium on 2013-12-31', '2013-12-31 00:00:00', '2013-12-31', '2013', 'DPA 4011 > V3 Digital + SBD > R44 (24/96)', 'SDHC Card > Sound Forge Pro 10.0 (Mix, Normalize, fades) > CD Wav (tracking) > TLH > Flac (level 8)', 'Brian V.', '*** This is a 24 bit recording, not intended for CD Burning ***\n\nDopapod\n2013-12-31\nThe Palladium\nWorcester, MA\n\nDPA 4011 > V3 Digital + SBD > R44 (24/96)\nSDHC Card > Sound Forge Pro 10.0 (Mix, Normalize, fades) > CD Wav (tracking) > TLH > Flac (level 8)\nDIN/ROC (right of FOH)/approx. 7\' high\nTags added in Foobar2000\n\nTaped and Transferred by Brian V.\n\n01. Intro\n02. Freight Train Filled With Dynamite >\n03. Give It A Name\n04. Bubblebrain ->\n05. Auld Lang Syne* ->\n06. Bubblebrain\n07. Indian Grits^ ->\n08. Vol. 3 #86 >\n09. Present Ghosts%\n10. Bahbi#\n11. banter\n12. Upside of Down >\n13. Roid Rage\n14. encore break\n15. We Are Not Alone ->\n16. Eight Years Ended\n17. outro', 'dopapod2013-12-31.dpa4011-sbd.flac24', '[{\"reviewbody\":\"Real special night for dopapod returning to a home crowd at the historic and beautiful palladium before a long winter tour, Scotty really turned it on and Eli\'s improvisations were beautiful. Real impressive bass on Give it a Name and Indian Grits from Chuck, and Gabriel\'s solo was out of this world, to back up a tremendous opening set from CTS, both bands making it through with new drummers tearing it up (Jeff Mann killed it keeping up with those crazy guys)  \",\"reviewtitle\":\"Intimate New Years Eve Bash \",\"reviewer\":\"Jostigan04\",\"reviewdate\":\"2014-01-04 20:39:44\",\"stars\":\"5\"}]', '1', '5', '301', '2014-02-28 02:22:38', '2014-02-28 02:22:38', '60', '4', '7596', '17', '1'), ('Dopapod Live at Toad\'s Place on 2013-04-18', '2013-04-18 00:00:00', '2013-04-18', '2013', 'Busman BSC2/K31 + Soundboard > Tascam DR-680 (24-bit/48k).', 'Sony Vegas Pro 11.0 (mixing) > Sony Sound Forge Pro 10.0 (0db Normalization; L3 UltraMaximizer Stereo; Fades) >  CDWave > FLAC24 via Trader\'s Little Helper @ Level 8.', 'Dave Pecoraro', 'Foreplay * > 8 Years Ended ^, Present Ghosts, STADA, Donna Lee %, Bluetooth, Flipped -> Vol. 3 #86, Roid Rage, Bats In The Cave Braindead\n\nE: Bubble Brain', 'dopapod2013-04-18.matrix.flac24', '[]', '0', '0', '302', '2014-02-28 02:22:39', '2014-02-28 02:22:39', '73', '4', '6608', '14', '0'), ('Dopapod Live at AURA Music & Arts Festival on 2013-02-17', '2013-02-17 00:00:00', '2013-02-17', '2013', 'Soundboard multitrack via Presonus StudioLive 16.4.2 (16-bit/48k).', 'Logic Pro 9 (mixing) > Sony Sound Forge Pro 10.0 (L3 UltraMaximizer Stereo; Resampled to 44.1k with iZotope 64-Bit SRC @ Highest quality) > FLAC16 via Trader\'s Little Helper @ Level 8.', 'Luke Stratton (Dopapod Official)', '8 Years Ended > Braindead, My Elephant Vs. Your Elephant,Indian Grits*, Weird Charlie^ > Turnin\' Knobs%, Black and White#, Psycho Nature@', 'dopapod2013-02-17.multitrack.flac16', '[]', '0', '0', '303', '2014-02-28 02:22:40', '2014-02-28 02:22:40', '131', '4', '5288', '8', '0'), ('Dopapod Live at Rex Theater on 2013-02-08', '2013-02-08 00:00:00', '2013-02-08', '2013', 'Schoeps MK41[DINa/FOB/DFC] >>> Schoeps KCY 250/5 >>>  Naiant LittleBox[Output Transformers] >>>  Darktrain Silver Interconnects >>> Sony PCM-M10[24-Bit/48kHz] + SBD >>> 16GB A-Data MicroSDHC Card[24-Bit/44.1kHz] [After Show]', 'WaveLab 6[Matrix/Normalize/Crystal Resampler/UV22HR Dither] > CD Wave 1.98 >  Traders Little Helper v2.6.0[Encode To FLAC/Level 8/Align On Sector Boundaries]', 'Bean', '01. Set Intro\n02. New James >>>\n03. STADA\n04. Give It A Name\n05. Bubblebrain\n06. Off The Cuff\n07. Present Ghosts\n08. Weird Charlie\n09. I Am The Slime\n10. Say What You Mean >>>\n11. Roid Rage\n12. Vol. 3 #86\nEncore\n13. Nuggy Jawson\n\nA \'Beats By Bean/Team Pittsburgh\' recording!', 'dopapod2013-02-08.mk41.sbd.matrix.flac16', '[{\"reviewbody\":\"Sorry for talking your ear off, too excited friday night!\",\"reviewtitle\":\"Thanks Bean!\",\"reviewer\":\"Carbohydrates\",\"reviewdate\":\"2013-02-11 23:24:17\",\"stars\":\"5\"}]', '1', '5', '304', '2014-02-28 02:22:40', '2014-02-28 02:22:40', '36', '4', '7694', '13', '1'), ('Dopapod Live at Tyrone Farm on 2013-04-21', '2013-04-21 00:00:00', '2013-04-21', '2013', 'Busman BSC2/K11 + Soundboard > Tascam DR-680 (24-bit/48k).', 'Sony Vegas Pro 11.0 (mixing) > Sony Sound Forge Pro 10.0 (0db Normalization; L3 UltraMaximizer Stereo; Fades) >  CDWave > FLAC24 via Trader\'s Little Helper @ Level 8.', 'Dave Pecoraro', 'I: Black and White, Cloud World, 8 Years Ended *, The National Anthem -> My Elephant vs. Your Elephant ** > Vol. 3 #86 ^ -> Onionhead ^^\n\nII: French Bowling %, Blast, Nude >, Trapper Keeper, Psycho Nature, I Believe I Can Fly, Off The Cuff', 'dopapod2013-04-21.bsc2matrix.flac24', '[{\"reviewbody\":\"Let me start by saying that this was not just a Dopapod show; this was a true musical family gathering. Potluck buffet, lawn games, picnic blankets, kids chasing labradors, a tangible sense of community, and bitchin setlists made this past sunday one of the best live music experiences of my entire life. Everyone involved in putting this together deserves a huge pat on the back, and massive doses of gratitude from music fans in CT and MA. Eli belting out I Believe I Can Fly for the encore was really special; that guy has some of the most righteous and heartfelt stage banter/audience shout outs of anyone in the biz, and for some reason I was really moved when he started singing. Highlights for me were 8 Years ended, Psycho Nature, Trapper Keeper. There was definitely something in the air that afternoon; felt like my first Phish show all over again.\",\"reviewtitle\":\"Wow, just wow... Return of the Dopabarn.\",\"reviewer\":\"Buquebus\",\"reviewdate\":\"2013-04-23 00:20:19\",\"stars\":\"5\"},{\"reviewbody\":\"what can I say other than this day made my soul truly feel good. Surrounded by wonderful people, amazing vibes, GREAT music and beautiful surroundings, I think I can safely say that this will be a show I\'ll always remember. A heartfelt thanks to Neal, Eli, Rob, Chuck, Luke and everyone involved in making this day happen. I feel like this show really demonstrated the wonderful community that this music is bringing together. So happy to be able to experience this with you all! Keep \'em coming and we\'ll be there!\",\"reviewtitle\":\"best day ever\",\"reviewer\":\"planetrockgd\",\"reviewdate\":\"2013-04-28 18:45:08\",\"stars\":\"5\"}]', '2', '5', '305', '2014-02-28 02:22:41', '2014-02-28 02:22:41', '100', '4', '7342', '15', '0'), ('Dopapod Live at The Blockley on 2013-02-23', '2013-02-23 00:00:00', '2013-02-23', '2013', 'Soundboard multitrack via Presonus StudioLive 16.4.2 (16-bit/48k).', 'Logic Pro 9 (mixing) > Sony Sound Forge Pro 10.0 (L3 UltraMaximizer Stereo; Resampled to 44.1k with iZotope 64-Bit SRC @ Highest quality) > FLAC16 via Trader\'s Little Helper @ Level 8.', 'Luke Stratton (Dopapod Official)', 'Roid Rage, Turnin\' Knobs, Vol. 3 #86, Indian Grits, Blast, Priorities, My Elephant Vs. Your Elephant, Present Ghosts, French Bowling, Freight Train Filled With Dynamite\n\nE: Trapper Keeper, The Happy Song > Weird Charlie Pt. 2', 'dopapod2013-02-23.multitrack.flac16', '[]', '0', '0', '306', '2014-02-28 02:22:42', '2014-02-28 02:22:42', '132', '4', '7575', '14', '0'), ('Dopapod Live at Summer Camp Music Festival on 2013-05-25', '2013-05-25 00:00:00', '2013-05-25', '2013', 'Schoeps MK41[DINa/ROC/SBD] >>> Schoeps KCY 250/5 >>>  Naiant LittleBox[Output Transformers] >>>  Darktrain Silver Interconnects >>> Sony PCM-M10[24-Bit/44.1kHz]', 'WaveLab 6[Normalize/UV22HR Dither] > CD Wave 1.98 >  Traders Little Helper v2.6.0[Encode To FLAC/Level 8/Align On Sector Boundaries] > FLAC16', 'Bean', '01. Set Intro\n02. Cloud World\n03. Trapper Keeper\n04. French Bowling\n05. Priorities\n06. Weird Charlie >>>\n07. You Oughta Know\n08. Bubble Brain\n09. Nuggy Jawson\nEncore\n10. Turnin\' Knobs\n\nA \'Beats By Bean/Team P